import React from 'react';
import './styles.css';

import { Menu, Dropdown, Button } from 'antd';

const dropdownMenuResults = [
    { url: 'http://www.alipay.com/', text: 'Khu vực thi Toàn quốc' },
    { url: 'http://www.alipay.com/', text: 'Xếp hạng các đoàn theo điểm' },
    { url: 'http://www.alipay.com/', text: 'Tổng hợp kết quả theo môn thi' },
    { url: 'http://www.alipay.com/', text: 'Tổng hợp điểm toàn quốc' },
    { url: 'http://www.alipay.com/', text: 'Tổng hợp huy chương toàn quốc' },
]

const mapdropdownMenuResults = dropdownMenuResults.map((todo, index) =>
  // Only do this if items have no stable IDs
  <li key={index}>
    {todo.text}
  </li>
);

export default class Header extends React.Component {
    render() {
        return (
            <div className="container">
                <div className="header" />
                <div className="navbar">
                    <div className="main-navbar">
                        <Button type="primary">TRANG CHỦ</Button>
                        <Button style={{ backgroundColor: '#336699', border: 'none', height: '40px', color: '#fff' }} >GIỚI THIỆU</Button>
                        <Dropdown overlay={mapdropdownMenuResults} placement="bottomLeft">
                            <Button style={{ backgroundColor: '#336699', border: 'none', height: '40px', color: '#fff' }} >KẾT QUẢ</Button>
                        </Dropdown>
                    </div>
                </div>
            </div>
        )
    }
}
